        public ParseResult FillRecordType(
            OverlayStream stream,
            int finalPos,
            int offset,
            RecordType type,
            PreviousParse lastParsed,
            Dictionary<RecordType, int>? recordParseCount,
            TypedParseParams translationParams = default)
        {
            type = translationParams.ConvertToStandard(type);
            switch (type.TypeInt)
            {
                case RecordTypeInts.PRPS:
                {
                    if (lastParsed.ShortCircuit((int)CrowdComponentItem_FieldIndex.Properties, translationParams)) return ParseResult.Stop;
                    this.Properties = BinaryOverlayList.FactoryByStartIndexWithTrigger<IObjectPropertyGetter>(
                        stream: stream,
                        package: _package,
                        finalPos: finalPos,
                        itemLength: 12,
                        getter: (s, p) => ObjectPropertyBinaryOverlay.ObjectPropertyFactory(s, p));
                    return (int)CrowdComponentItem_FieldIndex.Properties;
                }
                case RecordTypeInts.CTDA:
                case RecordTypeInts.CITC:
                {
                    if (lastParsed.ShortCircuit((int)CrowdComponentItem_FieldIndex.Conditions, translationParams)) return ParseResult.Stop;
                    this.Conditions = BinaryOverlayList.FactoryByCountPerItem<IConditionGetter>(
                        stream: stream,
                        package: _package,
                        countLength: 4,
                        trigger: Condition_Registration.TriggerSpecs,
                        countType: RecordTypes.CITC,
                        translationParams: translationParams,
                        getter: (s, p, recConv) => ConditionBinaryOverlay.ConditionFactory(new OverlayStream(s, p), p, recConv),
                        skipHeader: false);
                    return (int)CrowdComponentItem_FieldIndex.Conditions;
                }
                case RecordTypeInts.STRV:
                {
                    if (lastParsed.ShortCircuit((int)CrowdComponentItem_FieldIndex.STRV, translationParams)) return ParseResult.Stop;
                    _STRVLocation = (stream.Position - offset);
                    return (int)CrowdComponentItem_FieldIndex.STRV;
                }
                case RecordTypeInts.FLTV:
                {
                    if (lastParsed.ShortCircuit((int)CrowdComponentItem_FieldIndex.FLTV, translationParams)) return ParseResult.Stop;
                    _FLTVLocation = (stream.Position - offset);
                    return (int)CrowdComponentItem_FieldIndex.FLTV;
                }
                default:
                    return ParseResult.Stop;
            }
        }
